import About from '../pages/about/About'
import Find from '../pages/find/Find'
import Home from '../pages/home/Home'
import Login from '../pages/login/Login'
import Profile from '../pages/profile/Profile'
import Register from '../pages/register/Register'

const component = {
    About : {
        url: "/about",
        component: About
    },
    Find : {
        url: "/find",
        component: Find
    },
    Home : {
        Home: "/home",
        component: Home
    },
    Login : {
        url: "/login",
        component: Login
    },
    Profile : {
        url: "/profile",
        component: Profile
    },
    Register : {
        url: "/register",
        component: Register
    },
}

export default {
    guest: {
        allowedRoutes: [
            component.Home,
            component.Login,
            component.Register,
            component.About
        ]
    },
    user: {
        allowedRoutes: [
            component.Home,
            component.Profile,
            component.About
        ],
        redirectRoutes: '/profile'
    }
}
